class Spirit:
    name: str
    moves: {str: int}  # move name: lv obtained
    evolution: {str: int}  # evolution name: lv evolved
    type: str
    base_stats = {"HP": 0, "STA": 0, "ATT": 0, "DEF": 0, "SPE": 0}

    def __init__(self, name, moves, evo, t, base_stats):
        self.name = name
        self.moves = moves
        self.evolution = evo
        self.type = t
        self.base_stats = base_stats

    def __str__(self):
        return f"""{{name:"{self.name}", moves:{self.moves}, evolution:{self.evolution}, type:"{self.type}", stats:{self.base_stats}}}"""




